import React from "react";
import PropTypes from "prop-types";
// css
import "./Home.scss";
import Banner from "../../components/Banner/Banner";

function Home(props) {
  return (
    <main className="index">
      <section className="index-banner">
        <Banner />
      </section>
    </main>
  );
}

Home.propTypes = {};

export default Home;
